import http from "./http-common";

const get = id => {
    return http.get(`/api/StudyMaterial/${id}`);
};

const getStudyMaterials = tutorId => {
    return http.get(`/api/StudyMaterial/${tutorId}`)
}
const getAll = () => {
    return http.get(`/api/StudyMaterial`);
};


const StudyMaterialService = {
    get,
    getStudyMaterials,
    getAll,
};
export default StudyMaterialService;
